import { 
  Box
} from '@material-ui/core';

import '../styling/window.css';

import Navigation from './navigation';
import Home from './home';

import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";

const Window = ({
    
}) => {

  return(
    <Box
      id="window"
    >
      window
      <Navigation/>
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Home />} />
        </Routes>
        <Routes>
          <Route path="/home" element={<Home />} />
        </Routes>
      </BrowserRouter>
    </Box>
    )
}

export default Window;
